import React, { Component, Fragment } from 'react'
import { Container } from 'react-bootstrap'
import Slider from 'react-slick'

 class NewArrival extends Component {
    render() {
        var settings = {
            dots: false,
            infinite: false,
            speed: 500,
            autoplay: true,
            autoplaySpeed:3000,
            slidesToShow: 4,
            slidesToScroll: 1,
            initialSlide: 0,
            arrows: false,
            responsive: [
              {
                breakpoint: 1024,
                settings: {
                  slidesToShow: 4,
                  slidesToScroll: 1,
                  infinite: true,
                  dots: true
                }
              },
              {
                breakpoint: 600,
                settings: {
                  slidesToShow: 2,
                  slidesToScroll: 1,
                  initialSlide: 2
                }
              },
              {
                breakpoint: 480,
                settings: {
                  slidesToShow: 1,
                  slidesToScroll: 1
                }
              }
            ]
          };
        return (
           <Fragment>
               <Container className="text-center" fluid={true}>
          <div className="section-title text-center mb-55"><h2> NEW ARRIVAL</h2>
          <p>Some Of Our Exclusive Collection, You May Like</p>
          </div>

               </Container>


           </Fragment>
        )
    }
}

export default NewArrival
